import './navbar.css';

const Navbar = ({ dark }) => {
  const navbarColor = dark ? '#F2EEEE' : '#F2EEEE';
  return (
    <div className="navbar-wrapper" style={{
      backgroundColor: navbarColor,
    }}>
      <div className="logo-wrapper">
        <h2 className="logo-text"> BaatChit </h2>
      </div>
    </div>
  )
}

export default Navbar;
